    /**
     * Gestion des modles
     * Objet de gestion de la configuration des modles
     */
    $scope.modeles = {
        //0 : none
        //1 : unit
        //2 : all
        hasReload: 0,
        reloadName: "",
        isInit: false,
        hasSaved: false,
        list: [],
        current: {},
        init: function () {
            var that = this;
            this.hasReload = 0;
            this.hasSaved = false;
            this.current = {};
            if (!this.isInit) {
                this.list = Modeles.list(function () {
                    that.isInit = true;
                });
            }
        },
        get: function (model) {
            var that = this;
            this.hasSaved = false;
            model.$get(function () {
                that.current = angular.copy(model);
            });
        },
        set: function () {
            var that = this;
            this.hasReload = 0;
            this.current.$set(function () {
                that.hasSaved = true;
            });
        },
        reload: function (model) {
            var that = this;
            if (!!model) {
                model.$reload(function () {
                    that.hasReload = 1;
                    that.reloadName = model.name;
                    if (model.id === that.current.id) {
                        that.get(model);
                    }
                });
            } else {
                Modeles.reload(function () {
                    that.hasReload = 2;
                    that.hasSaved = false;
                });
            }
        },
        getHeight: function () {
            return Math.max($(window).height() - 112, 400);
        }
    };
